import React from 'react'
import { Box } from '@mui/material'

function Rightbar() {
  return (
    
    <Box bgcolor="pink" flex={2} p={2} sx={{display:{xs:"none", sm:"block"}}}>Rightbar</Box>
  )
}

export default Rightbar
